INSERT INTO `coursequestion` VALUES (1,1,1,''),(2,1,2,''),(3,1,3,''),(4,1,4,''),(5,1,5,''),(6,1,6,''),(7,2,1,'	Explore the potential for meaning through interactive storytelling \r\n	Develop understanding of the process of advancing plot and themes, and developing characters in an interactive story from idea to finished product \r\n	Learn to evaluate and to modify'),(8,2,2,'In CS we use Process Oriented Guided Inquiry Learning as our pedagogy. Through teamwork, individual assignments, quizzes, team quizzes, tests, an individual project, and a final team-oriented project and final team presentation, we will complete our learn'),(9,2,3,'Creative writing, along with block coding, will be the primary focus of the first half of the semester. This is necessary to prepare students with the skills and techniques necessary to create a Public Service Announcement (PSA). Not all students that tak'),(10,2,4,'Community Partner: Berea Food Bank. Collaborate with Tony Crachiolo. The first half of the course is structured to get the students prepared to create an animation as a PSA. During the first half, Mr. Crachiolo will be invited to the class to talk to us a'),(11,2,5,'The proposed final product to be completed by students with be an animated PSA. The PSA will be informed by input from the Berea Food Bank, along with feedback to students from questions asked.'),(12,2,6,'All components of the service learning component for the course are combined in the Final Project category (22.5% of the total grade). The weighting of the internal components of service-learning, including reflection, the intermediate steps between the i');
