TS office (Stephenson 205) starting on Monday, March 27 through Wednesday, March 29, 9 a.m. to 11:30 a.m. and 1:30 to 4:30 p.m., in the Alumni Lounge noon to 1 p.m., Monday through Wednesday,  or at the event on Thursday. ',NULL,8,0),(191,'Easter Egg Hunt',9,'15:00:00','18:00:00','Irvine Nursing and Rehabilitation (Pick up from Alumni Circle)',0,1,1,0,'2023-04-06','2023-04-06',NULL,'agp@berea.edu','Aimee Ninahaza',0,'Join us this Thursday for a fun Easter Egg Hunt with our lovely Irvine Nursing and Rehabilitation residents.\r\n\r\nWe\'ll all be delighted to have you around!',NULL,1,0),(192,'Habitat Connect #5',9,'18:00:00','19:00:00','CELTS Arts & Crafts',0,1,1,0,'2023-04-05','2023-04-05',NULL,'habitat@berea.edu','Chase Ackerman',0,'Join the Habitat team for a Wednesday evening of chill crafts and community building. \r\n\r\nPlease invite your friends!',NULL,5,0),(193,'AGP Volunteer Opportunity - Dominion Senior Living  Week 1',9,'17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-10-04','2022-10-04',14,'agp@berea.edu','Aimee Ninahaza',0,'Join us for a fun night with Dominion residents!',NULL,1,0),(194,'AGP Volunteer Opportunity - Dominion Senior Living  Week 2',9,'17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-10-11','2022-10-11',14,'agp@berea.edu','Aimee Ninahaza',0,'Join us for a fun night with Dominion residents!',NULL,1,0),(195,'AGP Volunteer Opportunity - Dominion Senior Living  Week 3',9,'17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-10-18','2022-10-18',14,'agp@berea.edu','Aimee Ninahaza',0,'Join us for a fun night with Dominion residents!',NULL,1,0),(196,'AGP Volunteer Opportunity - Dominion Senior Living  Week 4',9,'17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-10-25','2022-10-25',14,'agp@berea.edu','Aimee Ninahaza',0,'Join us for a fun night with Dominion residents!',NULL,1,0),(197,'AGP Volunteer Opportunity - Dominion Senior Living  Week 1',9,'17:30:00','19:30:00','Pick up from Alumni Circl